import TopNavBar from '../TopNavBar';
import React, { Component } from "react";
//import AddEmployee from "./Components/AddEmployee";
import { Route, BrowserRouter as Router } from "react-router-dom";
//import Table from "./Components/Table";
//import App from './App';
//import background from './charitybackground.jfif';
import ReactDOM from 'react-dom';
import Recipients from "../Components/Recipients";
import CharitiesList from '../Components/CharitiesList';
import { Container } from 'react-bootstrap';
import Footer from '../Footer';
import Home from '../Home';





class DonorCharities extends React.Component {




        constructor(props) {
            super(props);
            this.state = {
                currentPage: "DonorCharities"
            };
          }

    render() {
        return (
            <>
                <NavBarDonor data={this.state}/>
                <DonorCharitiesList />
                <Footer />
            </>
        )
    }
}

ReactDOM.render(
    <DonorCharities />,
    document.getElementById('root')
);

export default DonorCharities;
